import React from 'react';

function Overview() {
  return (
    <div>
      <h2>Overview</h2>
      <p>Welcome to EcoDash, your comprehensive guide to environmental and biodiversity information. Explore different categories to learn about various aspects of our planet's ecosystems and the challenges they face.</p>
    </div>
  );
}

export default Overview;
